import CTable from "src/Components/Table/CTable";

const StoreItems = () => {
  return (
    <>
      <CTable
        header={[
          "#",
          "Image",
          "Item Code",
          "Current Stock",
          "Last Updated",
          "Action",
        ]}
      ></CTable>
    </>
  );
};
export default StoreItems;
